declare const SQL_QUERY = "\nUPDATE OR IGNORE PersonPhone SET\n  \"createdAt\" = IFNULL(@createdAt, \"createdAt\"), \"updatedAt\" = IFNULL(@updatedAt, \"updatedAt\"), \"deletedAt\" = IFNULL(@deletedAt, \"deletedAt\"), \"type\" = IFNULL(@type, \"type\"), \"personId\" = IFNULL(@personId, \"personId\"), \"phoneId\" = IFNULL(@phoneId, \"phoneId\")\nWHERE\n  \"personId\" = @personId AND \"phoneId\" = @phoneId\n";
export default SQL_QUERY;
